// High or Low Pivot finder
function checkHighOrLow(currentval, arrSize, lengthForCheck, currentValueIndex, checkForHigh) {
    for (let i = 0; i < arrSize; i++) {

        if (checkForHigh) {
            afterVal = variable.candleMaxVals[currentValueIndex + i + 1]
            beforeVal = variable.candleMaxVals[currentValueIndex - i - 1]
            if (afterVal > currentval)
                return false;
            if (beforeVal > currentval)
                return false;
        } else {
            afterVal = variable.candleMinVals[currentValueIndex + i + 1]
            beforeVal = variable.candleMinVals[currentValueIndex - i - 1]
            if (afterVal < currentval)
                return false;
            if (beforeVal < currentval)
                return false;
        }
    }
    return true;
}

